SET SERVEROUTPUT ON
/
DECLARE
  r_cnt NUMBER := 0 ;
  TYPE t_names IS VARRAY(6) OF VARCHAR2(20);
  table_list t_names;
  
BEGIN

  table_list := t_names('A2_CINEMA', 'A2_STAFF', 'A2_FILM', 'A2_SCREEN', 'A2_SHOWING', 'A2_PERFORMANCE');
  
  DBMS_OUTPUT.PUT_LINE('Dropping Tables ...');
  
  FOR element IN 1 .. table_list.count LOOP
    SELECT COUNT (*) INTO r_cnt FROM all_tables WHERE TABLE_NAME = table_list(element) AND owner = (SELECT sys_context ('userenv', 'current_schema') from dual);
    IF (r_cnt > 0)
    THEN
      EXECUTE IMMEDIATE 'DROP TABLE ' || table_list(element) || ' CASCADE CONSTRAINTS';
      DBMS_OUTPUT.PUT_LINE(' ... ' || table_list(element));
    END IF;
  END LOOP;
  
  DBMS_OUTPUT.PUT_LINE('Create Tables ...');
  
  EXECUTE IMMEDIATE 'CREATE TABLE A2_Cinema
		      ( Cinema_Name	VARCHAR2(50) 	PRIMARY KEY,
  			Location	VARCHAR2(100),
  			Year_Opened	DATE,
  			Manager		VARCHAR2(8))';
  DBMS_OUTPUT.PUT_LINE(' ... A2_CINEMA');
  
  EXECUTE IMMEDIATE 'CREATE TABLE A2_Staff
		      ( Employee_No	VARCHAR2(8)	PRIMARY KEY,
  			Name		VARCHAR2(80)	NOT NULL,
  			Address		VARCHAR2(200)	NOT NULL,
  			Phone_No	VARCHAR2(11),
  			DoB		DATE NOT NULL,
  			Date_Joined	DATE NOT NULL,
 			  CHECK (Date_Joined > DoB),
  			Salary		NUMBER(8,2)	CHECK (Salary >= 0) NOT NULL,
			Supervisor	VARCHAR2(8) 	REFERENCES A2_Staff(Employee_No),
  			Cinema		VARCHAR2(50)	REFERENCES A2_Cinema(Cinema_Name) NOT NULL )';
  DBMS_OUTPUT.PUT_LINE(' ... A2_STAFF');
  
  EXECUTE IMMEDIATE 'ALTER TABLE A2_Cinema ADD
  			FOREIGN KEY (Manager) REFERENCES A2_Staff(Employee_No)';
  DBMS_OUTPUT.PUT_LINE(' ... A2_CINEMA (FK Manager added)');

  EXECUTE IMMEDIATE 'CREATE TABLE A2_Screen
		      ( Cinema		VARCHAR2(50)	REFERENCES A2_Cinema(Cinema_Name) NOT NULL,
			Screen		NUMBER(2,0)	NOT NULL,
  			  PRIMARY KEY (Cinema, Screen),
  			Capacity	NUMBER(4,0)	CHECK (Capacity > 0) NOT NULL )';
  DBMS_OUTPUT.PUT_LINE(' ... A2_SCREEN');

  EXECUTE IMMEDIATE 'CREATE TABLE A2_Film
		      ( Film_No		VARCHAR2(8) PRIMARY KEY,
  			Film_Name	VARCHAR2(80),
  			Classification	VARCHAR2(3)
				CHECK ( Classification IN ( ''U'', ''PG'', ''12A'', ''15'', ''18'')) NOT NULL,
  			Duration	NUMBER(3,0) CHECK (Duration > 0),
  			Description	VARCHAR2(2000),
  			Year_Released	DATE NOT NULL )';
  DBMS_OUTPUT.PUT_LINE(' ... A2_FILM');

  EXECUTE IMMEDIATE 'CREATE TABLE A2_Showing
		      ( Showing_No	VARCHAR2(6)	PRIMARY KEY,
  			Cinema		VARCHAR2(50)	NOT NULL,
  			Screen		NUMBER(2,0)	NOT NULL,
  			 FOREIGN KEY (Cinema, Screen) REFERENCES A2_Screen(Cinema, Screen),
  			Film_No		VARCHAR2(8) 	REFERENCES A2_Film(Film_No) NOT NULL )';
                           
  DBMS_OUTPUT.PUT_LINE(' ... A2_SHOWING');

  EXECUTE IMMEDIATE 'CREATE TABLE A2_Performance
		      ( Showing_No	  VARCHAR2(6)	NOT NULL REFERENCES A2_Showing(Showing_No),
			Performance_Date  DATE		NOT NULL,
			Performance_Time  DATE		NOT NULL,
  			 PRIMARY KEY (Showing_No, Performance_Date),
  			Takings		  NUMBER(7,2)   CHECK (Takings >= 0),
  			Attendees	  NUMBER(4,0)   CHECK (Attendees >= 0))';
  DBMS_OUTPUT.PUT_LINE(' ... A2_PERFORMANCE');
  DBMS_OUTPUT.PUT_LINE(' ');

  DBMS_OUTPUT.PUT_LINE('All tables created.');

  DBMS_OUTPUT.PUT_LINE('');
  DBMS_OUTPUT.PUT_LINE('Populate Tables ...');

