  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''23874985'', ''It Happened One Night'', ''U'', 105, ''A renegade reporter trailing a young runaway heiress for a big story joins her on a bus heading from Florida to New York.'', TO_DATE(''1934'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''73923747'', ''Modern Times'', ''U'', 87, ''A Tramp struggles to live in modern industrial society with the help of a young homeless woman.'', TO_DATE(''1936'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''27749483'', ''The Wizard of Oz'', ''U'', 102, ''Young Dorothy Gale and her dog are swept away by a tornado from their Kansas farm to the magical Land of Oz, and embark on a quest with three new friends to see the Wizard, who can return her to her home and fulfill the others'''' wishes.'', TO_DATE(''1939'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''90436272'', ''Black Panther'', ''12A'', 134, ''T''''Challa, heir to the hidden but advanced kingdom of Wakanda, must step forward to lead his people into a new future and must confront a challenger from his country''''s past.'', TO_DATE(''2018'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''23683940'', ''Citizen Kane'', ''U'', 119, ''Following the death of publishing tycoon Charles Foster Kane, reporters scramble to uncover the meaning of his final utterance; ''''Rosebud''''.'', TO_DATE(''1941'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''88594036'', ''Parasite'', ''15'', 132, ''Greed and class discrimination threaten the newly formed symbiotic relationship between the wealthy Park family and the destitute Kim clan.'', TO_DATE(''2019'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''88854033'', ''Avengers: Endgame'', ''12A'', 181, ''After the devastating events of Avengers: Infinity War, the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to reverse Thanos'''' actions and restore balance to the universe.'', TO_DATE(''2019'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''48950223'', ''Casablanca'', ''U'', 102, ''A cynical expatriate American cafe owner struggles to decide whether or not to help his former lover and her fugitive husband escape the Nazis in French Morocco.'', TO_DATE(''1942'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''22093939'', ''Knives Out'', ''12A'', 130, ''A detective investigates the death of a patriarch of an eccentric, combative family.'', TO_DATE(''2019'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''19984679'', ''Us'', ''15'', 116, ''A family''''s serene beach vacation turns to chaos when their doppelgängers appear and begin to terrorize them.'', TO_DATE(''2019'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''77302984'', ''Get Out'', ''15'', 104, ''A young African-American visits his white girlfriend''''s parents for the weekend, where his simmering uneasiness about their reception of him eventually reaches a boiling point.'', TO_DATE(''2017'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''63009805'', ''All about Eve'', ''U'', 158, ''A seemingly timid but secretly ruthless ingénue insinuates herself into the lives of an aging Broadway star and her circle of theater friends.'', TO_DATE(''1950'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''38874392'', ''North by North West'', ''PG'', 136, ''A New York City advertising executive goes on the run after being mistaken for a government agent by a group of foreign spies, and falls for a woman whose loyalties he begins to doubt.'', TO_DATE(''1959'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''49920322'', ''Psycho'', ''15'', 109, ''A Phoenix secretary embezzles $40,000 from her employer''''s client, goes on the run, and checks into a remote motel run by a young man under the domination of his mother.'', TO_DATE(''1960'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''29888794'', ''L.A. Confidential'', ''15'', 138, ''As corruption grows in 1950s Los Angeles, three policemen - one strait-laced, one brutal, and one sleazy - investigate a series of murders with their own brand of justice.'', TO_DATE(''1934'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''14145673'', ''A Hard Day''''s Night'', ''PG'', 97, ''Over two "typical" days in the life of The Beatles, the boys struggle to keep themselves and Paul McCartney''''s mischievous grandfather in check while preparing for a live TV performance.'', TO_DATE(''1964'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''38874372'', ''The Godfather'', ''15'', 175, ''The Godfather follows Vito Corleone Don of the Corleone family as he passes the mantel to his son Michael.'', TO_DATE(''1972'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''49921422'', ''Alien'', 15, 117, ''After a space merchant vessel receives an unknown transmission as a distress call, one of the crew is attacked by a mysterious life form and they soon realize that its life cycle has merely begun.'', TO_DATE(''1979'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''29333794'', ''King Kong'', ''U'', 100, ''A film crew goes to a tropical island for an exotic location shoot and discovers a colossal ape who takes a shine to their female blonde star. He is then captured and brought back to New York City for public exhibition.'', TO_DATE(''1933'', ''YYYY''))';
  EXECUTE IMMEDIATE 'INSERT INTO A2_Film VALUES (''16165673'', ''The Blues Brothers'', ''15'', 133, ''Jake Blues rejoins with his brother Elwood after being released from prison, but the duo has just days to reunite their old RnB band and save the Catholic home where the two were raised, outrunning the police as they tear through Chicago.'', TO_DATE(''1980'', ''YYYY''))';

  DBMS_OUTPUT.PUT_LINE(' ... A2_Film');

